import React, {useState} from 'react';
import {View, Text, StyleSheet, Image} from 'react-native';
import {ScrollView} from 'react-native-gesture-handler';
import {
  heightPercentageToDP as hp,
  widthPercentageToDP as wp,
} from 'react-native-responsive-screen';
import {SvgXml} from 'react-native-svg';
import {RFValue} from 'react-native-responsive-fontsize';
import { appImages } from '../commons/AppImages';
import { fonts } from '../theme/fonts/fonts';
import { colors } from '../theme/colors';

const NumberBoxComponent = () => {
  const [activeStep, setActiveStep] = useState(3);

  const TotalStepsView = () => {
    return (
      <View style={styles.totalMainView}>
        <Image
          source={appImages.countCoinIcon}
          style={styles.totalMainImageView}
          resizeMode="stretch"
        />
        <View style={styles.totalIneerView}>
          <SvgXml xml={rupee} />
          <Text style={styles.totalTextView}>50</Text>
        </View>
      </View>
    );
  };
  const CircleView = isActive => {
    return (
      <View style={styles.circleWrapper}>
        {isActive ? (
          <View style={[styles.circle, {backgroundColor:colors.main}]}>
            <SvgXml xml={tick} />
          </View>
        ) : (
          <View style={[styles.circle]}></View>
        )}
      </View>
    );
  };
  const renderStep = step => {
    const isActive = activeStep >= step;

    return (
      <View style={styles.renderViewMain}>
        <View style={isActive ? styles.activeBox : styles.inActiveBox}>
          <Text style={styles.stepTextView}>{step}</Text>
        </View>
        <View key={step} style={styles.stepWrapper}>
          <View
            style={[
              step == 1 ? styles.lineGone : styles.line,
              step != 1 && isActive && styles.activeLine,
            ]}
          />
          {CircleView(isActive)}
          <View
            style={[
              step == 50 ? styles.lineGone : styles.line,
              step != 50 && step < activeStep && styles.activeLine,
            ]}
          />
        </View>
      </View>
    );
  };

  return (
    <View style={styles.container}>
     <View style={styles.innerView}>
      <TotalStepsView />
      <ScrollView 
      horizontal 
      showsHorizontalScrollIndicator={false}
      contentContainerStyle={{paddingRight:'20%'}}
      >
        <View style={styles.stepContainer}>
          {Array.from({length: 50}, (_, index) => renderStep(index + 1))}
        </View>
      </ScrollView>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    paddingVertical:15,
    marginHorizontal: 20,
    marginTop: 20,
    backgroundColor:colors.white,
    borderRadius:10,
    shadowColor:colors.black,
    shadowOffset: {width: 0, height: 5},
    shadowOpacity: 0.1,
    shadowRadius: 10,
    elevation: 5,
  },
  innerView:{
    flexDirection:'row',
     marginLeft:10,
    justifyContent:'center'
  },
  renderViewMain: {
    justifyContent:'flex-start'
  },
  totalMainView: {
    marginRight:'1%',
    justifyContent:'center'
  },
  totalMainImageView: {
    width: wp('14%'),
    height: hp('10%'),
  },
  totalIneerView: {
    position: 'absolute',
    bottom: 0,
    top: hp('-1%'),
    left: 0,
    right: 0,
    alignItems: 'center',
    justifyContent: 'center',
  },
  totalTextView: {
    marginTop: 6,
    fontFamily:fonts.semiBold,
    fontSize: RFValue(15),
    color: colors.black,
  },
  stepTextView: {
    marginTop: 6,
    fontFamily: fonts.semiBold,
    fontSize: RFValue(11),
    color: colors.black,
  },
  activeBox: {
    backgroundColor:colors.colorC9,
    borderWidth: 1,
    borderColor:colors.main,
    alignItems: 'center',
    justifyContent: 'center',
    padding: 10,
    height: hp('6%'),
    width: wp('14%'),
    marginHorizontal: 3,
  },
  inActiveBox: {
    backgroundColor:colors.colorD9,
    alignItems: 'center',
    justifyContent: 'center',
    padding: 10,
    height: hp('6%'),
    width: wp('14%'),
    marginHorizontal: 3,
  },
  stepContainer: {
    paddingHorizontal:2,
    flexDirection: 'row',
    justifyContent:'center'
  },
  stepWrapper: {
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'center',
    marginTop: 6,
  },
  circleWrapper: {
    zIndex: 1,
  },
  circle: {
    width: 20,
    height: 20,
    borderRadius: 20,
    backgroundColor:colors.colorD9,
    justifyContent: 'center',
    alignItems: 'center',
  },
  line: {
    width: wp('5.3%'),
    height: 2,
    backgroundColor: colors.colorD9,
    zIndex: 0,
  },
  lineGone: {
    width: wp('5.3%'),
    height: 2,
    zIndex: 0,
  },
  activeLine: {
    backgroundColor:colors.main,
  },
});
const tick = `<svg xmlns="http://www.w3.org/2000/svg" width="10" height="7" viewBox="0 0 10 7" fill="none">
<path d="M8.66665 0.75L3.62498 5.79167L1.33331 3.5" stroke="white" stroke-linecap="round" stroke-linejoin="round"/>
</svg>`;
const rupee = `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="35" height="35" viewBox="0 0 35 35" fill="none">
<rect width="35" height="35" fill="url(#pattern0_3487_5872)"/>
<defs>
<pattern id="pattern0_3487_5872" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlink:href="#image0_3487_5872" transform="scale(0.000488281)"/>
</pattern>
<image id="image0_3487_5872" width="2048" height="2048" preserveAspectRatio="none" xlink:href="data:image/png;base64,"/>
</defs>
</svg>`;

export default NumberBoxComponent;